import React, { Component } from 'react';
import {Element} from 'react-scroll';
import Image from './front_page_backgrnd.png';

class About extends Component {

  render() {
    return (
    	<React.Fragment>

    		<img src={Image} style={{height:400,width:350,position:'absolute',top:130,left:150}} />
    		<div style={{position:'absolute',top:100,left:600}}>
    		hello
    		</div>
    	</React.Fragment >
    );
  }
}

export default About;
